package StringPractice;

public class Swap_To_Num {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10,b=30;
//		a=a+b; //40
//		b=a-b; //10
//		a=a-b;//30
		
		
		a=a*b; //300
		b=a/b; //10
		a=a/b; //30
		
		System.out.println(a);//30
		System.out.println(b);//10
		
	}

}
